import React, {useState} from 'react'

import Card from 'react-bootstrap/Card';
import CardGroup from 'react-bootstrap/CardGroup';

 
function Home() {
    const [products] = useState([
        {
            id: 1,
            image: <img src = {require('../assets/item1.jpg')}/>,
            title:'Nike Hat',
            price:'$40',
            description:'Personalized Comfort. The Nike Sportswear Pro adjustable cap sports a classic six-panel design and press-on back for a personalized fit and Comfort'
    
        },
        {
            id: 1,
            image:'',
            title:'Nike Hat',
            price:'$100',
            description:''
    
        },
        {
            id: 1,
            image:'',
            title:'Nike Hat',
            price:'$100',
            description:''
    
        }
    
     ]);
  return (
    <div>
         <h3 className='text-center mt-5'>Fashion</h3>
         <CardGroup>
     {products.map((product)=> (
        
        <Card>
            <h1></h1>
        {product.image}>
        <Card.Body>
          <Card.Title>{product.title}</Card.Title>
          <Card.Text>{product.description}</Card.Text>
        </Card.Body>
        <Card.Footer>
          <small className="text-muted">Last updated 3 mins ago</small>
        </Card.Footer>
      </Card>
      
     ))}
      
    </CardGroup>
    </div>
   
  );
}

export default Home;
